window.bookSummaryJSON = "<p><b>The highly anticipated third installment of the steamy Artefacts of Ouranos series journeys deeper into the glittering fae world as Lor puts both her life and her heart on the line in this enemies-to-lovers fantasy romance.</b></p> <p>With the Heart Crown now in her possession, Lor must navigate the dangers of being an heir on the run, knowing more than one power-hungry ruler is after her blood. When she returns to Aphelion to unlock her magic and recover her family's legacy, it becomes clearer than ever that all that's gold doesn't sparkle. No stranger to battles, she continues to fight her attraction to the Aurora Prince, understanding this might be the one she finally loses.</p> <p>As the past mixes with the present, Lor uncovers the truth about the Artefacts and their role in shaping her destiny. Now, her future hangs in the balance, leaving her closer than ever to getting everything she's ever wanted...or losing it all forever.</p>"; 
